class App extends React.Component {
  helpText = "Help text!";
  render() {
    return (
      <div>
        <Header title="Sapka sayta" />
        <Header title="Sapka!" />
        <Header title="!!!" />
        <input
          placeholder={this.helpText}
          onClick={this.inputClick}
          onMouseEnter={this.mouseOver}
        />
        <h1>Privet voram</h1>
        <p>{this.helpText === "Help text!" ? "Yes" : "No"}</p>
        <Image image="R.png"/>
      </div>
    );
  }
  inputClick() {
    console.log("Clicked");
  }
  mouseOver() {
    console.log("Mouse Over");
  }
}

export default App
